// Function Component
import React from "react";
const PageHeader = (props) => {
  return (
    <div className="center">
      <h1>{props.title}</h1>
    </div>
  );
};
// ProductList
const ProductList = () => {
  const products = [
    { id: 1, name: "Apple", price: 10 },
    { id: 2, name: "PineApple", price: 20 },
    { id: 3, name: "Lemon", price: 5 },
  ];
  return (
    <div className="list">
      <h3>Product List</h3>
      {products.map((product) => (
        <ul key={product.id}>
          <li>
            {product.name}: ${product.price}
          </li>
        </ul>
      ))}
    </div>
  );
};
export { ProductList, PageHeader };
